import { Component } from '@angular/core';
import { CommonModule } from '@angular/common';

@Component({
  selector: 'app-apartamento',
  standalone: true,
  imports: [CommonModule],
  templateUrl: './apartamento.component.html',
  styleUrls: ['./apartamento.component.css']
})
export default class ApartamentoComponent {

}
<div class="shadow-lg bg-white w-full h-full rounded-md py-4 px-6">
    <h5>Controlador de entrada e saída do veículo</h5>
</div>
